import React, { Component } from 'react';
import { Jumbotron, ListGroup } from 'react-bootstrap';
import '../index.css'

class HomePage extends Component {
    state = {}
    render() {
        return (
            <Jumbotron>
                <h4 className='font-test' style={{ color: '#343a40' }}>Quickly and easily determine the redemption value of your bonds</h4>
                <ListGroup style={{ width: '25em', margin: '2em 0 0 2em' }}>
                    <ListGroup.Item>Price individual bonds</ListGroup.Item>
                    <ListGroup.Item>Price bonds from a spreadsheet (.csv file)</ListGroup.Item>
                </ListGroup>
            </Jumbotron >
        )
    }
}

export default HomePage;
